import './Player.css';

function Player(props) {
    return (
        <div className="PlayerBox">
            <div>
                <text>Name:</text> 
                <text>{props.name}</text>
            </div>
            <text>Side: {props.side}</text>
        </div>
    );
}

export default Player;
